import { useEffect, useState } from "react";
import { Link } from "react-router";

function Coursses()
{
    const [coursses, setCoursses] = useState([]);
    useEffect(() => {
        fetch('http://localhost:9000/corsses')
        .then((res) => res.json())
        .then((data) => {
            console.log(data);
            setCoursses(data);
        })
        .catch((error) => {
            console.error('Error fetching courses:', error);
        });
}, []);
    return (

        
        <>
            <h1>Coursses Page</h1>

            <Link to={'/coursses/add'} className="btn btn-success mt-3">Add New Course</Link>

            <table className="table table-striped mt-5">
                <tr>
                    <th> ID</th>
                    <th> Course Title</th>
                    <th> Coach's name</th>
                    <th> Description</th>
                    <th> Duration by days</th>
                    <th> operations</th>
               
                </tr>
                <tr>
                    {coursses.map()}
                    <td>1</td>
                    <td>java scripte</td>
                    <td>joan's</td>
                    <td>1sdsa</td>
                    <td>33</td>
                    <td>
                        <button className="btn btn-danger">Delete</button>
                        <button className="btn btn-info">View</button>
                    </td>
                </tr>
            </table>
        </>
    );
}
export default Coursses;
